import React from 'react';
const Screenheight =() =>{
    var height = screen.height +'px';
    console.log(height);
}
const Scroll = (props,Screenheight) => {
    return (
        <div style={{ overflow:'scroll',height:'767px'}}>
            {props.children}
        </div>
    )
}
export default Scroll;
